import {CgMenuRight} from 'react-icons/cg'

const Header = () => {
  return (
    <header className='py-[30px] lg:pt-[60px]'>
      <div className='container mx-auto'>
        {/*Logo*/}
        <a href='#'>
          <img src={Logo} alt=''></img>
        </a>

        {/*Nav and buttons*/}
        <div>
          <Nav/>
          
        </div>
      </div>
    </header>
  );
  
};

export default Header;
